import React, { useCallback } from "react";
import ReactFlow, {
  Background,
  Controls,
  MiniMap,
  Handle,
  Position,
  addEdge,
  useNodesState,
  useEdgesState
} from "reactflow";
import "reactflow/dist/style.css";

const ChatNode = ({ id, data }) => {
  return (
    <div className="bg-white shadow-lg rounded-xl p-4 min-w-[220px] border border-gray-200 relative">

      <Handle type="target" position={Position.Top} />

      <div
        contentEditable
        suppressContentEditableWarning
        className="outline-none text-sm text-gray-800"
      >
        {data.label}
      </div>

      <div className="flex justify-between mt-3 text-xs">
        <button
          onClick={() => data.onAddChild(id)}
          className="px-2 py-1 bg-blue-500 text-white rounded hover:bg-blue-600"
        >
          Reply
        </button>

        <button
          onClick={() => data.onDelete(id)}
          className="px-2 py-1 bg-red-500 text-white rounded hover:bg-red-600"
        >
          Delete
        </button>
      </div>

      <Handle type="source" position={Position.Bottom} />
    </div>
  );
};

const nodeTypes = {
  chat: ChatNode
};

export default function Home() {
  const initialNodes = [
    {
      id: "1",
      type: "chat",
      position: { x: 400, y: 100 },
      data: {}
    }
  ];

  const [nodes, setNodes, onNodesChange] = useNodesState(initialNodes);
  const [edges, setEdges, onEdgesChange] = useEdgesState([]);

  const onConnect = useCallback(
    (params) => setEdges((eds) => addEdge({ ...params, animated: true }, eds)),
    []
  );

  const addChild = (parentId) => {
    const newId = Date.now().toString();

    const parentNode = nodes.find(n => n.id === parentId);

    const newNode = {
      id: newId,
      type: "chat",
      position: {
        x: parentNode.position.x,
        y: parentNode.position.y + 150
      },
      data: {}
    };

    setNodes((nds) =>
      nds.concat({
        ...newNode,
        data: {
          label: "New message",
          onAddChild: addChild,
          onDelete: deleteNode
        }
      })
    );

    setEdges((eds) =>
      eds.concat({
        id: `e${parentId}-${newId}`,
        source: parentId,
        target: newId,
        animated: true
      })
    );
  };

  const deleteNode = (id) => {
    setNodes((nds) => nds.filter((n) => n.id !== id));
    setEdges((eds) =>
      eds.filter((e) => e.source !== id && e.target !== id)
    );
  };

  return (
    <div className="w-full h-full h-[600px] bg-neutral-900">

    </div>
  );
}
